    "7302104": {
        "Desc": "Obtain \"Living Spring\"",
        "Step": "Help Arapas get the \"Living Spring\" to complete the \"Supreme Delicacy.\"",
        "Talk": [
            [
                {
                    "N": "Arapas",
                    "T": "Hmm... It is the water from the river's source. The Living Spring that's cold and clean, just like moonlight."
                },
                {
                    "N": "Arapas",
                    "T": "Arachatora, Arasaka, and Araphala wouldn't be so stupid if they grew up drinking this water. Only Arapacati, my sister..."
                },
                {
                    "N": "_1005",
                    "T": "Well, what's next..."
                },
                {
                    "N": "Arapas",
                    "T": "Huh? Oh. Next up, you have to make me a new pot of soup..."
                },
                {
                    "N": "???",
                    "T": "Receiving guidance from Arapas, you add some fruits and vegetables into the water and start cooking.\\nA rather nice aroma slowly emerges from the pot."
                },
                {
                    "N": "???",
                    "T": "Once you're done, you taste the fresh soup together.\\nIt sort of lives up to your expectations. It does carry the aroma of the ingredients...\\nBut a soup without any condiments is just too plain.\\nIt has no flavor at all."
                },
                {
                    "N": "Arapas",
                    "T": "Mmm, this is how the supreme delicacy should smell!"
                },
                {
                    "N": "_1005",
                    "T": "#Hmm... What do you think, {NICKNAME}?"
                },
                {
                    "N": "_0",
                    "T": "It can quench thirst as soups should."
                },
                {
                    "N": "_0",
                    "T": "It's too healthy for me, I think..."
                },
                {
                    "N": "_1005",
                    "T": "Paimon thinks it would be better with some salt and pepper."
                },
                {
                    "N": "_0",
                    "T": "Everything is better with salt and pepper."
                },
                {
                    "N": "Arapas",
                    "T": "Great Aramuhukunda! You want to add salt? What a horrifying idea!"
                },
                {
                    "N": "Arapas",
                    "T": "Land with salt is land without life, and Aranara will be forced to shrink into seeds. Yet Nara wish to add salt!?"
                },
                {
                    "N": "Arapas",
                    "T": "Soups are supposed to be bland! How do you Nara not even understand that!?"
                },
                {
                    "N": "Arapas",
                    "T": "That Nara from before told us a story after having a bowl of my soup:"
                },
                {
                    "N": "Arapas",
                    "T": "\"When we Nara children come home, the aroma of soup is the first thing we smell. As such, aroma is all a soup needs.\""
                },
                {
                    "N": "Arapas",
                    "T": "#After that, {F#he}{M#she} complimented the aroma of the soup I made. I've never forgotten that. That's why I won't believe a word you say!"
                },
                {
                    "N": "_1005",
                    "T": "But just aroma isn't enough..."
                },
                {
                    "N": "Arapas",
                    "T": "..."
                },
                {
                    "N": "Arapas",
                    "T": "Hmph! But since you're the Nara of this Festival Utsava, I'm sure you've received approval from Araja and Arapacati. So... I'll try making a soup with taste."
                },
                {
                    "N": "Arapas",
                    "T": "Next time, I'll look for even better water, so we can make even better soup!"
                },
                {
                    "N": "_0",
                    "T": "...I don't think water is the problem."
                },
                {
                    "N": "Arapas",
                    "T": "Really? Anyway, my cooking training has concluded. Alright, let's see what we can do about this at Festival Utsava!"
                },
                {
                    "N": "Arapas",
                    "T": "I've taught you how to make the soup. It's a soup approved by the Great Nara, so do give it a few more tries. But make sure you don't forget to use good water!"
                },
                {
                    "N": "_1005",
                    "T": "#({NICKNAME}, let's add some seasoning next time. It should be pretty good after that...)"
                }
            ]
        ]
    },
