    "7302006": {
        "Desc": "Use Dendro to heal the Aranara",
        "Talk": []
    },
    "7302003": {
        "Desc": "Look for the \"Head Mushroom\"",
        "Step": "Help Arachatora get the \"Head Mushroom\" to complete the \"Supreme Delicacy.\"",
        "Talk": [
            [
                {
                    "N": "Arachatora",
                    "T": "I'm so lucky to have met both of you."
                },
                {
                    "N": "Arachatora",
                    "T": "It's the smell of a fully matured Head Mushroom. It's richer than ever."
                },
                {
                    "N": "Arachatora",
                    "T": "So, you grew well even when Marana took over your habitat. You're amazing."
                },
                {
                    "N": "_1005",
                    "T": "Uh, so... Can we taste it?"
                },
                {
                    "N": "Arachatora",
                    "T": "Of course. Putting aside how you've helped me, serving the most delicious mushroom dish to Nara again has always been the goal of my cooking training."
                },
                {
                    "N": "_1005",
                    "T": "Oh yeah! Head Mushroom!"
                },
                {
                    "N": "???",
                    "T": "Arachatora immediately starts cooking...\\nThe fresh aroma of the mushroom bursts out from the pot."
                },
                {
                    "N": "???",
                    "T": "Once it's ready, Arachatora serves it to you and Paimon.\\nShould it be considered disappointing? Or conforming to expectations? Because it's tasteless.\\nBesides that, it's filled with vitality and too tough to the point of being difficult to chew."
                },
                {
                    "N": "Arachatora",
                    "T": "...It's done. My cooking training has finally been completed successfully. What do you think? I'm sure it's the best delicacy to a Nara."
                },
                {
                    "N": "_1005",
                    "T": "*nom nom* *gulp* Uh... how should Paimon put this..."
                },
                {
                    "N": "_0",
                    "T": "*chew forcefully*"
                },
                {
                    "N": "_0",
                    "T": "*swallow forcefully*"
                },
                {
                    "N": "_0",
                    "T": "It's edible. If you try hard enough."
                },
                {
                    "N": "_0",
                    "T": "At least it isn't poisonous."
                },
                {
                    "N": "_0",
                    "T": "It's a little too early for me to have something like this."
                },
                {
                    "N": "_1005",
                    "T": "Hmm... It's a very fragrant mushroom indeed, but its texture and taste don't really suit us."
                },
                {
                    "N": "Arachatora",
                    "T": "Huh?"
                },
                {
                    "N": "Arachatora",
                    "T": "#How could this be? When I served it to the other Nara from before, {F#he}{M#she} said it was good."
                },
                {
                    "N": "_1005",
                    "T": "From before?"
                },
                {
                    "N": "Arachatora",
                    "T": "#I served my mushroom dish to a Nara some time ago, and because it was so good, {F#he}{M#she} swallowed it with so much vigor."
                },
                {
                    "N": "Arachatora",
                    "T": "It should be fine."
                },
                {
                    "N": "_1005",
                    "T": "..."
                },
                {
                    "N": "_0",
                    "T": "..."
                },
                {
                    "N": "Arachatora",
                    "T": "Oh, just like every Aranara grows different leaves, the taste of the mushroom may not suit all Nara."
                },
                {
                    "N": "_1005",
                    "T": "Right... Speaking of leaves... Are Aranara not afraid of fire? You look like you're covered in leaves..."
                },
                {
                    "N": "Arachatora",
                    "T": "Of course it's scary. Forest fires sometimes raze entire forests until only barren ground remains."
                },
                {
                    "N": "Arachatora",
                    "T": "But it's for my cooking training, so keeping my fear at bay and controlling the temperature of the flames is also a part of my training."
                },
                {
                    "N": "_1005",
                    "T": "So that's how it is... Anyway, guess it's time to go back. Arapacati is waiting for you guys!"
                },
                {
                    "N": "Arachatora",
                    "T": "Yes, I'll head back to Vanarana immediately. I can't keep my precious sister worrying about me."
                },
                {
                    "N": "Arachatora",
                    "T": "As for the others... Arasaka, Arapas, and Araphala are around <color=#00E1FFFF>Gandharva Ville</color>, <color=#00E1FFFF>Apam Woods</color>, and <color=#00E1FFFF>Devantaka Mountain</color>."
                },
                {
                    "N": "Arachatora",
                    "T": "#Thank you. Golden Nara {NICKNAME} is dazzling like the sun, and Paimon is quite amazing, too. I'll leave my sister's request to you."
                },
                {
                    "N": "_1005",
                    "T": "Why is Paimon only quite amazing!?"
                },
                {
                    "N": "Arachatora",
                    "T": "Oh, don't worry about that... Anyway, I don't know how to repay you for all the help you've given me..."
                },
                {
                    "N": "Arachatora",
                    "T": "Hmm... I've decided to give you my Supreme Delicacy's recipe. Perhaps you'll grow fond of its taste as you age."
                },
                {
                    "N": "_1005",
                    "T": "#({NICKNAME}, if Paimon modifies this recipe a little, it should be able to become a pretty good original dish!)"
                }
            ]
        ]
    },
