    "7302206": {
        "Desc": "",
        "Talk": [
            [
                {
                    "N": "Araphala",
                    "T": "Okay, let's start cooking with the Unrivaled Fresh Fruits."
                },
                {
                    "N": "_1005",
                    "T": "What's the difference between this \"Unrivaled Fresh Fruit\" and ordinary fruits?"
                },
                {
                    "N": "Araphala",
                    "T": "I understand. To Nara, all fruits may be the same, but they are different."
                },
                {
                    "N": "Araphala",
                    "T": "Only strong trees can bear Unrivaled Fresh Fruits. Strong trees sing first when the wind blows."
                },
                {
                    "N": "Araphala",
                    "T": "The bearings of the strong trees, these Unrivaled Fresh Fruits, are a blessing to us. That Nara friend said these fruits are so tasty they sing in your stomach."
                },
                {
                    "N": "_1005",
                    "T": "Paimon can't wait to see what kind of delicacy will be made from them!"
                },
                {
                    "N": "???",
                    "T": "Araphala starts cooking right away...\\nHe divides the fruits equally...\\nThen, he gives a few portions to you and Paimon."
                },
                {
                    "N": "???",
                    "T": "You try the fresh fruits together.\\nIt sort of lives up to your expectations. They do taste like fresh fruits."
                },
                {
                    "N": "Araphala",
                    "T": "So good. Thank you, strong trees."
                },
                {
                    "N": "_1005",
                    "T": "Wait! You call that cooking?"
                },
                {
                    "N": "Araphala",
                    "T": "The Unrivaled Fresh Fruit itself is the best Supreme Delicacy. It doesn't need any extra processing to present its best taste..."
                },
                {
                    "N": "Araphala",
                    "T": "Just taste it and you will understand."
                },
                {
                    "N": "_1005",
                    "T": "It is tasty, but it's just... it's just like eating fruits..."
                },
                {
                    "N": "_0",
                    "T": "It is a fruit after all."
                },
                {
                    "N": "_1005",
                    "T": "Yeah, Paimon guesses so..."
                },
                {
                    "N": "Araphala",
                    "T": "Don't you Nara have a dish where you cut fruits and serve them on a wooden board too?"
                },
                {
                    "N": "_1005",
                    "T": "Huh? Do we? Wait! Are you talking about a fruit platter?"
                },
                {
                    "N": "_1005",
                    "T": "Is a fruit platter considered a dish?"
                },
                {
                    "N": "_0",
                    "T": "I think so?"
                },
                {
                    "N": "_1005",
                    "T": "It still seems a bit strange to Paimon..."
                },
                {
                    "N": "_0",
                    "T": "I don't think so..."
                },
                {
                    "N": "_1005",
                    "T": "Right? It's kinda strange to call something that hasn't been, y'know, processed... a dish."
                },
                {
                    "N": "Araphala",
                    "T": "Oh, don't be a stickler for things like that. Finding better ingredients is a form of cooking too."
                },
                {
                    "N": "Araphala",
                    "T": "While searching for ingredients, I can travel the forest and get closer to it. That's the true meaning of my cooking training."
                },
                {
                    "N": "_1005",
                    "T": "Is it?"
                },
                {
                    "N": "Araphala",
                    "T": "It sure is."
                },
                {
                    "N": "Araphala",
                    "T": "I've picked Unrivaled Fresh Fruits and made my Supreme Delicacy. My cooking training is complete."
                },
                {
                    "N": "Araphala",
                    "T": "I can return proudly to Vanarana."
                },
                {
                    "N": "Araphala",
                    "T": "#Oh, I would've missed Festival Utsava if Nara {NICKNAME} and Paimon didn't take care of that huge monster that blocked me here in this cave."
                },
                {
                    "N": "_1005",
                    "T": "Alright, hurry back to Vanarana!"
                },
                {
                    "N": "Araphala",
                    "T": "Indeed, indeed... Sister will scold me if I miss Festival Utsava... Just the thought of it is scary enough."
                }
            ]
        ]
    },
